import React, { Component } from 'react';
import { Layout, Menu, Icon } from 'antd';

const { Sider } = Layout;

class LeftSideBar extends Component {
  render() {
    return (
      <Layout style={{ minHeight: '100vh' }}>
        <Sider>
          <div className="logo" />
          <Menu theme="dark" defaultSelectedKeys={['1']} mode="inline">
            <Menu.Item key="1" >
              <Link to="/doashboard/loans" />
              <Icon type="pie-chart" />
              <span>Loans</span>
            </Menu.Item>
            <Menu.Item key="2">
              <Icon type="desktop" />
              <span>Loans Approves</span>
            </Menu.Item>
            <Menu.Item key="9">
              <Icon type="file" />
              <span>Repayments</span>
            </Menu.Item>
          </Menu>
        </Sider>
      </Layout>
    );
  }
}

export default LeftSideBar;
